CREATE TABLE detailpta (
  id INT(11) NOT NULL AUTO_INCREMENT,
  pta_id INT(11) NOT NULL,
  indicateur_id INT(11) DEFAULT NULL,
  personnel_id INT(11) DEFAULT NULL,
  lignebudgetaire_id INT(11) DEFAULT NULL,
  secteur_id INT(11) DEFAULT NULL,
  valeurobjectif VARCHAR(255) DEFAULT NULL,
  datedebut DATE DEFAULT NULL,
  datefin DATE DEFAULT NULL,
  support_id INT(11) DEFAULT NULL,
  seance_id INT(11) DEFAULT NULL,
  PRIMARY KEY (id),
  INDEX FK_datail_pta_indicateur_id (indicateur_id),
  INDEX FK_datail_pta_personnel_id (personnel_id),
  INDEX FK_datail_pta_pta_id (pta_id),
  INDEX FK_datailpta_ligne_budgetaire_id (lignebudgetaire_id),
  INDEX FK_datailpta_secteur_id (secteur_id),
  INDEX FK_detailpta (seance_id),
  INDEX FK_detailpta_support_id (support_id),
  CONSTRAINT FK_datail_pta_indicateur_id FOREIGN KEY (indicateur_id)
    REFERENCES indicateur(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_datail_pta_personnel_id FOREIGN KEY (personnel_id)
    REFERENCES personnel(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_datail_pta_pta_id FOREIGN KEY (pta_id)
    REFERENCES pta(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_datailpta_ligne_budgetaire_id FOREIGN KEY (lignebudgetaire_id)
    REFERENCES lignebudgetaire(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_datailpta_secteur_id FOREIGN KEY (secteur_id)
    REFERENCES secteur(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_detailpta FOREIGN KEY (seance_id)
    REFERENCES organisationaction(id) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT FK_detailpta_support_id FOREIGN KEY (support_id)
    REFERENCES support(id) ON DELETE CASCADE ON UPDATE CASCADE
)
ENGINE = INNODB
AUTO_INCREMENT = 1
